package com.sajansthapit.authserver.config.bootstrap.dto;import java.util.List;public class BootstrapDefaultClientDto {    private String clientId;    private String clientName;    private String clientSecret;    private List<String> authenticationMethod;    private List<String> authorizationGrantType;    private String redirectUri;    private String postLogoutRedirectUri;    private List<String> scope;    private boolean requireConsent;    public BootstrapDefaultClientDto() {    }    public BootstrapDefaultClientDto(String clientId, String clientName, String clientSecret, List<String> authenticationMethod, List<String> authorizationGrantType, String redirectUri, String postLogoutRedirectUri, List<String> scope, boolean requireConsent) {        this.clientId = clientId;        this.clientName = clientName;        this.clientSecret = clientSecret;        this.authenticationMethod = authenticationMethod;        this.authorizationGrantType = authorizationGrantType;        this.redirectUri = redirectUri;        this.postLogoutRedirectUri = postLogoutRedirectUri;        this.scope = scope;        this.requireConsent = requireConsent;    }    public String getClientId() {        return clientId;    }    public void setClientId(String clientId) {        this.clientId = clientId;    }    public String getClientName() {        return clientName;    }    public void setClientName(String clientName) {        this.clientName = clientName;    }    public String getClientSecret() {        return clientSecret;    }    public void setClientSecret(String clientSecret) {        this.clientSecret = clientSecret;    }    public List<String> getAuthenticationMethod() {        return authenticationMethod;    }    public void setAuthenticationMethod(List<String> authenticationMethod) {        this.authenticationMethod = authenticationMethod;    }    public List<String> getAuthorizationGrantType() {        return authorizationGrantType;    }    public void setAuthorizationGrantType(List<String> authorizationGrantType) {        this.authorizationGrantType = authorizationGrantType;    }    public String getRedirectUri() {        return redirectUri;    }    public void setRedirectUri(String redirectUri) {        this.redirectUri = redirectUri;    }    public String getPostLogoutRedirectUri() {        return postLogoutRedirectUri;    }    public void setPostLogoutRedirectUri(String postLogoutRedirectUri) {        this.postLogoutRedirectUri = postLogoutRedirectUri;    }    public List<String> getScope() {        return scope;    }    public void setScope(List<String> scope) {        this.scope = scope;    }    public boolean isRequireConsent() {        return requireConsent;    }    public void setRequireConsent(boolean requireConsent) {        this.requireConsent = requireConsent;    }}